export const Monitor=()=> {
  return (
    <Box
        component="main"
        sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}>
        <Toolbar />
      <h1>Monitor </h1>
    </Box>
  );
};
